INSERT INTO ONetJobs values(15201100, 'https://www.onetonline.org/link/summary/15-2011.00', 'Actuaries', 'Research, Development, Design, and Practitioners', 'Analyze statistical data, such as mortality, accident, sickness, disability, and retirement rates and construct probability tables to forecast risk and liability for payment of future benefits. May ascertain insurance rates required and cash reserves necessary to ensure payment of future benefits.');
INSERT INTO ONetJobs values(29129100, 'https://www.onetonline.org/link/summary/29-1291.00', 'Acupuncturists', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, and prevent disorders by stimulating specific acupuncture points within the body using acupuncture needles. May also use cups, nutritional supplements, therapeutic massage, acupressure, and other alternative health therapies.');
INSERT INTO ONetJobs values(29114101, 'https://www.onetonline.org/link/summary/29-1141.01', 'Acute Care Nurses', 'Research, Development, Design, and Practitioners', 'Provide advanced nursing care for patients with acute conditions such as heart attacks, respiratory distress syndrome, or shock. May care for pre- and post-operative patients or perform advanced, invasive diagnostic or therapeutic procedures.');
INSERT INTO ONetJobs values(29114102, 'https://www.onetonline.org/link/summary/29-1141.02', 'Advanced Practice Psychiatric Nurses', 'Research, Development, Design, and Practitioners', 'Assess, diagnose, and treat individuals and families with mental health or substance use disorders or the potential for such disorders. Apply therapeutic activities, including the prescription of medication, per state regulations, and the administration of psychotherapy.');
INSERT INTO ONetJobs values(17302100, 'https://www.onetonline.org/link/summary/17-3021.00', 'Aerospace Engineering and Operations Technologists and Technicians', 'Technologists and Technicians', 'Operate, install, adjust, and maintain integrated computer/communications systems, consoles, simulators, and other data acquisition, test, and measurement instruments and equipment, which are used to launch, track, position, and evaluate air and space vehicles. May record and interpret test data.');
INSERT INTO ONetJobs values(17201100, 'https://www.onetonline.org/link/summary/17-2011.00', 'Aerospace Engineers', 'Research, Development, Design, and Practitioners', 'Perform engineering duties in designing, constructing, and testing aircraft, missiles, and spacecraft. May conduct basic and applied research to evaluate adaptability of materials and equipment to aircraft design and manufacture. May recommend improvements in testing equipment and techniques.');
INSERT INTO ONetJobs values(17202100, 'https://www.onetonline.org/link/summary/17-2021.00', 'Agricultural Engineers', 'Research, Development, Design, and Practitioners', 'Apply knowledge of engineering technology and biological science to agricultural problems concerned with power and machinery, electrification, structures, soil and water conservation, and processing of agricultural products.');
INSERT INTO ONetJobs values(25104100, 'https://www.onetonline.org/link/summary/25-1041.00', 'Agricultural Sciences Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in the agricultural sciences. Includes teachers of agronomy, dairy sciences, fisheries management, horticultural sciences, poultry sciences, range management, and agricultural soil conservation. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(19401200, 'https://www.onetonline.org/link/summary/19-4012.00', 'Agricultural Technicians', 'Technologists and Technicians', 'Work with agricultural scientists in plant, fiber, and animal research, or assist with animal breeding and nutrition. Set up or maintain laboratory equipment and collect samples from crops or animals. Prepare specimens or record data to assist scientists in biology or related life science experiments. Conduct tests and experiments to improve yield and quality of crops or to increase the resistance of plants and animals to disease or insects.');
INSERT INTO ONetJobs values(29122901, 'https://www.onetonline.org/link/summary/29-1229.01', 'Allergists and Immunologists', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, and help prevent allergic diseases and disease processes affecting the immune system.');
INSERT INTO ONetJobs values(29107101, 'https://www.onetonline.org/link/summary/29-1071.01', 'Anesthesiologist Assistants', 'Research, Development, Design, and Practitioners', 'Assist anesthesiologists in the administration of anesthesia for surgical and non-surgical procedures. Monitor patient status and provide patient care during surgical treatment.');
INSERT INTO ONetJobs values(29121100, 'https://www.onetonline.org/link/summary/29-1211.00', 'Anesthesiologists', 'Research, Development, Design, and Practitioners', 'Administer anesthetics and analgesics for pain management prior to, during, or after surgery.');
INSERT INTO ONetJobs values(19101100, 'https://www.onetonline.org/link/summary/19-1011.00', 'Animal Scientists', 'Research, Development, Design, and Practitioners', 'Conduct research in the genetics, nutrition, reproduction, growth, and development of domestic farm animals.');
INSERT INTO ONetJobs values(19309100, 'https://www.onetonline.org/link/summary/19-3091.00', 'Anthropologists and Archeologists', 'Research, Development, Design, and Practitioners', 'Study the origin, development, and behavior of human beings. May study the way of life, language, or physical characteristics of people in various parts of the world. May engage in systematic recovery and examination of material evidence, such as tools or pottery remaining from past human cultures, in order to determine the history, customs, and living habits of earlier civilizations.');
INSERT INTO ONetJobs values(25106100, 'https://www.onetonline.org/link/summary/25-1061.00', 'Anthropology and Archeology Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in anthropology or archeology. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(17101100, 'https://www.onetonline.org/link/summary/17-1011.00', 'Architects, Except Landscape and Naval', 'Research, Development, Design, and Practitioners', 'Plan and design structures, such as private residences, office buildings, theaters, factories, and other structural property.');
INSERT INTO ONetJobs values(17301100, 'https://www.onetonline.org/link/summary/17-3011.00', 'Architectural and Civil Drafters', 'Technologists and Technicians', 'Prepare detailed drawings of architectural and structural features of buildings or drawings and topographical relief maps used in civil engineering projects, such as highways, bridges, and public works. Use knowledge of building materials, engineering practices, and mathematics to complete drawings.');
INSERT INTO ONetJobs values(11904100, 'https://www.onetonline.org/link/summary/11-9041.00', 'Architectural and Engineering Managers', 'Managerial', 'Plan, direct, or coordinate activities in such fields as architecture and engineering or research and development in these fields.');
INSERT INTO ONetJobs values(25103100, 'https://www.onetonline.org/link/summary/25-1031.00', 'Architecture Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in architecture and architectural design, such as architectural environmental design, interior architecture/design, and landscape architecture. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(25106200, 'https://www.onetonline.org/link/summary/25-1062.00', 'Area, Ethnic, and Cultural Studies Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses pertaining to the culture and development of an area, an ethnic group, or any other group, such as Latin American studies, womens studies, or urban affairs. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(29112901, 'https://www.onetonline.org/link/summary/29-1129.01', 'Art Therapists', 'Research, Development, Design, and Practitioners', 'Plan or conduct art therapy sessions or programs to improve clients physical, cognitive, or emotional well-being.');
INSERT INTO ONetJobs values(19201100, 'https://www.onetonline.org/link/summary/19-2011.00', 'Astronomers', 'Research, Development, Design, and Practitioners', 'Observe, research, and interpret astronomical phenomena to increase basic knowledge or apply such information to practical problems.');
INSERT INTO ONetJobs values(29909100, 'https://www.onetonline.org/link/summary/29-9091.00', 'Athletic Trainers', 'Research, Development, Design, and Practitioners', 'Evaluate and treat musculoskeletal injuries or illnesses. Provide preventive, therapeutic, emergency, and rehabilitative care.');
INSERT INTO ONetJobs values(19202100, 'https://www.onetonline.org/link/summary/19-2021.00', 'Atmospheric and Space Scientists', 'Research, Development, Design, and Practitioners', 'Investigate atmospheric phenomena and interpret meteorological data, gathered by surface and air stations, satellites, and radar to prepare reports and forecasts for public and other uses. Includes weather analysts and forecasters whose functions require the detailed knowledge of meteorology.');
INSERT INTO ONetJobs values(25105100, 'https://www.onetonline.org/link/summary/25-1051.00', 'Atmospheric, Earth, Marine, and Space Sciences Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in the physical sciences, except chemistry and physics. Includes both teachers primarily engaged in teaching, and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(29118100, 'https://www.onetonline.org/link/summary/29-1181.00', 'Audiologists', 'Research, Development, Design, and Practitioners', 'Assess and treat persons with hearing and related disorders. May fit hearing aids and provide auditory training. May perform research related to hearing problems.');
INSERT INTO ONetJobs values(17302701, 'https://www.onetonline.org/link/summary/17-3027.01', 'Automotive Engineering Technicians', 'Technologists and Technicians', 'Assist engineers in determining the practicality of proposed product design changes and plan and carry out tests on experimental test devices or equipment for performance, durability, or efficiency.');
INSERT INTO ONetJobs values(17214102, 'https://www.onetonline.org/link/summary/17-2141.02', 'Automotive Engineers', 'Research, Development, Design, and Practitioners', 'Develop new or improved designs for vehicle structural members, engines, transmissions, or other vehicle systems, using computer-assisted design technology. Direct building, modification, or testing of vehicle or components.');
INSERT INTO ONetJobs values(19102100, 'https://www.onetonline.org/link/summary/19-1021.00', 'Biochemists and Biophysicists', 'Research, Development, Design, and Practitioners', 'Study the chemical composition or physical principles of living cells and organisms, their electrical and mechanical energy, and related phenomena. May conduct research to further understanding of the complex chemical combinations and reactions involved in metabolism, reproduction, growth, and heredity. May determine the effects of foods, drugs, serums, hormones, and other substances on tissues and vital processes of living organisms.');
INSERT INTO ONetJobs values(17203100, 'https://www.onetonline.org/link/summary/17-2031.00', 'Bioengineers and Biomedical Engineers', 'Research, Development, Design, and Practitioners', 'Apply knowledge of engineering, biology, chemistry, computer science, and biomechanical principles to the design, development, and evaluation of biological, agricultural, and health systems and products, such as artificial organs, prostheses, instrumentation, medical information systems, and health management and care delivery systems.');
INSERT INTO ONetJobs values(11904101, 'https://www.onetonline.org/link/summary/11-9041.01', 'Biofuels/Biodiesel Technology and Product Development Managers', 'Managerial', 'Define, plan, or execute biofuels/biodiesel research programs that evaluate alternative feedstock and process technologies with near-term commercial potential.');
INSERT INTO ONetJobs values(19102901, 'https://www.onetonline.org/link/summary/19-1029.01', 'Bioinformatics Scientists', 'Research, Development, Design, and Practitioners', 'Conduct research using bioinformatics theory and methods in areas such as pharmaceuticals, medical technology, biotechnology, computational biology, proteomics, computer information science, biology and medical informatics. May design databases and develop algorithms for processing and analyzing genomic information, or other biological information.');
INSERT INTO ONetJobs values(15209901, 'https://www.onetonline.org/link/summary/15-2099.01', 'Bioinformatics Technicians', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Apply principles and methods of bioinformatics to assist scientists in areas such as pharmaceuticals, medical technology, biotechnology, computational biology, proteomics, computer information science, biology and medical informatics. Apply bioinformatics tools to visualize, analyze, manipulate or interpret molecular data. May build and maintain databases for processing and analyzing genomic or other biological information.');
INSERT INTO ONetJobs values(25104200, 'https://www.onetonline.org/link/summary/25-1042.00', 'Biological Science Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in biological sciences. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(19102900, 'https://www.onetonline.org/link/summary/19-1029.00', 'Biological Scientists, All Other', 'Research, Development, Design, and Practitioners', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(19402100, 'https://www.onetonline.org/link/summary/19-4021.00', 'Biological Technicians', 'Technologists and Technicians', 'Assist biological and medical scientists. Set up, operate, and maintain laboratory instruments and equipment, monitor experiments, collect data and samples, make observations, and calculate and record results. May analyze organic substances, such as blood, food, and drugs.');
INSERT INTO ONetJobs values(19102904, 'https://www.onetonline.org/link/summary/19-1029.04', 'Biologists', 'Research, Development, Design, and Practitioners', 'Research or study basic principles of plant and animal life, such as origin, relationship, development, anatomy, and functions.');
INSERT INTO ONetJobs values(15204101, 'https://www.onetonline.org/link/summary/15-2041.01', 'Biostatisticians', 'Research, Development, Design, and Practitioners', 'Develop and apply biostatistical theory and methods to the study of life sciences.');
INSERT INTO ONetJobs values(15129907, 'https://www.onetonline.org/link/summary/15-1299.07', 'Blockchain Engineers', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Maintain and support distributed and decentralized blockchain-based networks or block-chain applications such as cryptocurrency exchange, payment processing, document sharing, and digital voting. Design and deploy secure block-chain design patterns and solutions over geographically distributed networks using advanced technologies. May assist with infrastructure setup and testing for application transparency and security.');
INSERT INTO ONetJobs values(15205101, 'https://www.onetonline.org/link/summary/15-2051.01', 'Business Intelligence Analysts', 'Research, Development, Design, and Practitioners', 'Produce financial and market intelligence by querying data repositories and generating periodic reports. Devise methods for identifying data patterns and trends in available information sources.');
INSERT INTO ONetJobs values(17302800, 'https://www.onetonline.org/link/summary/17-3028.00', 'Calibration Technologists and Technicians', 'Technologists and Technicians', 'Execute or adapt procedures and techniques for calibrating measurement devices, by applying knowledge of measurement science, mathematics, physics, chemistry, and electronics, sometimes under the direction of engineering staff. Determine measurement standard suitability for calibrating measurement devices. May perform preventive maintenance on equipment. May perform corrective actions to address identified calibration problems.');
INSERT INTO ONetJobs values(29121200, 'https://www.onetonline.org/link/summary/29-1212.00', 'Cardiologists', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, manage, and prevent diseases or conditions of the cardiovascular system. May further subspecialize in interventional procedures (e.g., balloon angioplasty and stent placement), echocardiography, or electrophysiology.');
INSERT INTO ONetJobs values(29203100, 'https://www.onetonline.org/link/summary/29-2031.00', 'Cardiovascular Technologists and Technicians', 'Technologists and Technicians', 'Conduct tests on pulmonary or cardiovascular systems of patients for diagnostic, therapeutic, or research purposes. May conduct or assist in electrocardiograms, cardiac catheterizations, pulmonary functions, lung capacity, and similar tests.');
INSERT INTO ONetJobs values(17102100, 'https://www.onetonline.org/link/summary/17-1021.00', 'Cartographers and Photogrammetrists', 'Technologists and Technicians', 'Research, study, and prepare maps and other spatial data in digital or graphic form for one or more purposes, such as legal, social, political, educational, and design purposes. May work with Geographic Information Systems (GIS). May design and evaluate algorithms, data structures, and user interfaces for GIS and mapping systems. May collect, analyze, and interpret geographic information provided by geodetic surveys, aerial photographs, and satellite data.');
INSERT INTO ONetJobs values(17204100, 'https://www.onetonline.org/link/summary/17-2041.00', 'Chemical Engineers', 'Research, Development, Design, and Practitioners', 'Design chemical plant equipment and devise processes for manufacturing chemicals and products, such as gasoline, synthetic rubber, plastics, detergents, cement, paper, and pulp, by applying principles and technology of chemistry, physics, and engineering.');
INSERT INTO ONetJobs values(19403100, 'https://www.onetonline.org/link/summary/19-4031.00', 'Chemical Technicians', 'Technologists and Technicians', 'Conduct chemical and physical laboratory tests to assist scientists in making qualitative and quantitative analyses of solids, liquids, and gaseous materials for research and development of new products or processes, quality control, maintenance of environmental standards, and other work involving experimental, theoretical, or practical application of chemistry and related sciences.');
INSERT INTO ONetJobs values(25105200, 'https://www.onetonline.org/link/summary/25-1052.00', 'Chemistry Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses pertaining to the chemical and physical properties and compositional changes of substances. Work may include providing instruction in the methods of qualitative and quantitative chemical analysis. Includes both teachers primarily engaged in teaching, and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(19203100, 'https://www.onetonline.org/link/summary/19-2031.00', 'Chemists', 'Research, Development, Design, and Practitioners', 'Conduct qualitative and quantitative chemical analyses or experiments in laboratories for quality or process control or to develop new products or knowledge.');
INSERT INTO ONetJobs values(29101100, 'https://www.onetonline.org/link/summary/29-1011.00', 'Chiropractors', 'Research, Development, Design, and Practitioners', 'Assess, treat, and care for patients by manipulation of spine and musculoskeletal system. May provide spinal adjustment or address sacral or pelvic misalignment.');
INSERT INTO ONetJobs values(17302200, 'https://www.onetonline.org/link/summary/17-3022.00', 'Civil Engineering Technologists and Technicians', 'Technologists and Technicians', 'Apply theory and principles of civil engineering in planning, designing, and overseeing construction and maintenance of structures and facilities under the direction of engineering staff or physical scientists.');
INSERT INTO ONetJobs values(17205100, 'https://www.onetonline.org/link/summary/17-2051.00', 'Civil Engineers', 'Research, Development, Design, and Practitioners', 'Perform engineering duties in planning, designing, and overseeing construction and maintenance of building structures and facilities, such as roads, railroads, airports, bridges, harbors, channels, dams, irrigation projects, pipelines, power plants, and water and sewage systems.');
INSERT INTO ONetJobs values(19204101, 'https://www.onetonline.org/link/summary/19-2041.01', 'Climate Change Policy Analysts', 'Research, Development, Design, and Practitioners', 'Research and analyze policy developments related to climate change. Make climate-related recommendations for actions such as legislation, awareness campaigns, or fundraising approaches.');
INSERT INTO ONetJobs values(19303300, 'https://www.onetonline.org/link/summary/19-3033.00', 'Clinical and Counseling Psychologists', 'Research, Development, Design, and Practitioners', 'Assess, diagnose, and treat mental and emotional disorders of individuals through observation, interview, and psychological tests. Help individuals with distress or maladjustment understand their problems through their knowledge of case history, interviews with patients, and theory. Provide individual or group counseling services to assist individuals in achieving more effective personal, social, educational, and vocational development and adjustment. May design behavior modification programs and consult with medical personnel regarding the best treatment for patients.');
INSERT INTO ONetJobs values(15205102, 'https://www.onetonline.org/link/summary/15-2051.02', 'Clinical Data Managers', 'Research, Development, Design, and Practitioners', 'Apply knowledge of health care and database management to analyze clinical data, and to identify and report trends.');
INSERT INTO ONetJobs values(19303903, 'https://www.onetonline.org/link/summary/19-3039.03', 'Clinical Neuropsychologists', 'Research, Development, Design, and Practitioners', 'Assess and diagnose patients with neurobehavioral problems related to acquired or developmental disorders of the nervous system, such as neurodegenerative disorders, traumatic brain injury, seizure disorders, and learning disabilities. Recommend treatment after diagnosis, such as therapy, medication, or surgery. Assist with evaluation before and after neurosurgical procedures, such as deep brain stimulation.');
INSERT INTO ONetJobs values(29114104, 'https://www.onetonline.org/link/summary/29-1141.04', 'Clinical Nurse Specialists', 'Research, Development, Design, and Practitioners', 'Direct nursing staff in the provision of patient care in a clinical practice setting, such as a hospital, hospice, clinic, or home. Ensure adherence to established clinical policies, protocols, regulations, and standards.');
INSERT INTO ONetJobs values(11912101, 'https://www.onetonline.org/link/summary/11-9121.01', 'Clinical Research Coordinators', 'Managerial', 'Plan, direct, or coordinate clinical research projects. Direct the activities of workers engaged in clinical research projects to ensure compliance with protocols and overall clinical objectives. May evaluate and analyze clinical data.');
INSERT INTO ONetJobs values(15122100, 'https://www.onetonline.org/link/summary/15-1221.00', 'Computer and Information Research Scientists', 'Research, Development, Design, and Practitioners', 'Conduct research into fundamental computer and information science as theorists, designers, or inventors. Develop solutions to problems in the field of computer hardware and software.');
INSERT INTO ONetJobs values(11302100, 'https://www.onetonline.org/link/summary/11-3021.00', 'Computer and Information Systems Managers', 'Managerial', 'Plan, direct, or coordinate activities in such fields as electronic data processing, information systems, systems analysis, and computer programming.');
INSERT INTO ONetJobs values(17206100, 'https://www.onetonline.org/link/summary/17-2061.00', 'Computer Hardware Engineers', 'Research, Development, Design, and Practitioners', 'Research, design, develop, or test computer or computer-related equipment for commercial, industrial, military, or scientific use. May supervise the manufacturing and installation of computer or computer-related equipment and components.');
INSERT INTO ONetJobs values(15124100, 'https://www.onetonline.org/link/summary/15-1241.00', 'Computer Network Architects', 'Research, Development, Design, and Practitioners', 'Design and implement computer and information networks, such as local area networks (LAN), wide area networks (WAN), intranets, extranets, and other data communications networks. Perform network modeling, analysis, and planning, including analysis of capacity needs for network infrastructures. May also design network and computer security measures. May research and recommend network and data communications hardware and software.');
INSERT INTO ONetJobs values(15123100, 'https://www.onetonline.org/link/summary/15-1231.00', 'Computer Network Support Specialists', 'Technologists and Technicians', 'Analyze, test, troubleshoot, and evaluate existing network systems, such as local area networks (LAN), wide area networks (WAN), cloud networks, servers, and other data communications networks. Perform network maintenance to ensure networks operate correctly with minimal interruption.');
INSERT INTO ONetJobs values(15129900, 'https://www.onetonline.org/link/summary/15-1299.00', 'Computer Occupations, All Other', 'Research, Development, Design, and Practitioners; Technologists and Technicians', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(15125100, 'https://www.onetonline.org/link/summary/15-1251.00', 'Computer Programmers', 'Research, Development, Design, and Practitioners', 'Create, modify, and test the code and scripts that allow computer applications to run. Work from specifications drawn up by software and web developers or other individuals. May develop and write computer programs to store, locate, and retrieve specific documents, data, and information.');
INSERT INTO ONetJobs values(25102100, 'https://www.onetonline.org/link/summary/25-1021.00', 'Computer Science Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in computer science. May specialize in a field of computer science, such as the design and function of computers or operations and research analysis. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(15121100, 'https://www.onetonline.org/link/summary/15-1211.00', 'Computer Systems Analysts', 'Research, Development, Design, and Practitioners', 'Analyze science, engineering, business, and other data processing problems to develop and implement solutions to complex applications problems, system administration issues, or network concerns. Perform systems management and integration functions, improve existing computer systems, and review computer system capabilities, workflow, and schedule limitations. May analyze or recommend commercially available software.');
INSERT INTO ONetJobs values(15129908, 'https://www.onetonline.org/link/summary/15-1299.08', 'Computer Systems Engineers/Architects', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Design and develop solutions to complex applications problems, system administration issues, or network concerns. Perform systems management and integration functions.');
INSERT INTO ONetJobs values(15123200, 'https://www.onetonline.org/link/summary/15-1232.00', 'Computer User Support Specialists', 'Technologists and Technicians', 'Provide technical assistance to computer users. Answer questions or resolve computer problems for clients in person, via telephone, or electronically. May provide assistance concerning the use of computer hardware and software, including printing, installation, word processing, electronic mail, and operating systems.');
INSERT INTO ONetJobs values(19103100, 'https://www.onetonline.org/link/summary/19-1031.00', 'Conservation Scientists', 'Research, Development, Design, and Practitioners', 'Manage, improve, and protect natural resources to maximize their use without damaging the environment. May conduct soil surveys and develop plans to eliminate soil erosion or to protect rangelands. May instruct farmers, agricultural production managers, or ranchers in best ways to use crop rotation, contour plowing, or terracing to conserve soil and water; in the number and kind of livestock and forage plants best suited to particular ranges; and in range and farm improvements, such as fencing and reservoirs for stock watering.');
INSERT INTO ONetJobs values(29114103, 'https://www.onetonline.org/link/summary/29-1141.03', 'Critical Care Nurses', 'Research, Development, Design, and Practitioners', 'Provide specialized nursing care for patients in critical or coronary care units.');
INSERT INTO ONetJobs values(29201101, 'https://www.onetonline.org/link/summary/29-2011.01', 'Cytogenetic Technologists', 'Technologists and Technicians', 'Analyze chromosomes or chromosome segments found in biological specimens, such as amniotic fluids, bone marrow, solid tumors, and blood to aid in the study, diagnosis, classification, or treatment of inherited or acquired genetic diseases. Conduct analyses through classical cytogenetic, fluorescent in situ hybridization (FISH) or array comparative genome hybridization (aCGH) techniques.');
INSERT INTO ONetJobs values(29201102, 'https://www.onetonline.org/link/summary/29-2011.02', 'Cytotechnologists', 'Technologists and Technicians', 'Stain, mount, and study cells to detect evidence of cancer, hormonal abnormalities, and other pathological conditions following established standards and practices.');
INSERT INTO ONetJobs values(15205100, 'https://www.onetonline.org/link/summary/15-2051.00', 'Data Scientists', 'Research, Development, Design, and Practitioners', 'Develop and implement a set of techniques or analytics applications to transform raw data into meaningful information using data-oriented programming languages and visualization software. Apply data mining, data modeling, natural language processing, and machine learning to extract and analyze information from large structured and unstructured datasets. Visualize, interpret, and report data findings. May create dynamic data reports.');
INSERT INTO ONetJobs values(15124301, 'https://www.onetonline.org/link/summary/15-1243.01', 'Data Warehousing Specialists', 'Research, Development, Design, and Practitioners', 'Design, model, or implement corporate data warehousing activities. Program and configure warehouses of database information and provide support to warehouse users.');
INSERT INTO ONetJobs values(15124200, 'https://www.onetonline.org/link/summary/15-1242.00', 'Database Administrators', 'Research, Development, Design, and Practitioners', 'Administer, test, and implement computer databases, applying knowledge of database management systems. Coordinate changes to computer databases. Identify, investigate, and resolve database performance issues, database capacity, and database scalability. May plan, coordinate, and implement security measures to safeguard computer databases.');
INSERT INTO ONetJobs values(15124300, 'https://www.onetonline.org/link/summary/15-1243.00', 'Database Architects', 'Research, Development, Design, and Practitioners', 'Design strategies for enterprise databases, data warehouse systems, and multidimensional networks. Set standards for database operations, programming, query processes, and security. Model, design, and construct large relational databases or data warehouses. Create and optimize data models for warehouse infrastructure and workflow. Integrate new systems with existing warehouse structure and refine system performance and functionality.');
INSERT INTO ONetJobs values(29129200, 'https://www.onetonline.org/link/summary/29-1292.00', 'Dental Hygienists', 'Research, Development, Design, and Practitioners', 'Administer oral hygiene care to patients. Assess patient oral hygiene problems or needs and maintain health records. Advise patients on oral health maintenance and disease prevention. May provide advanced care such as providing fluoride treatment or administering topical anesthesia.');
INSERT INTO ONetJobs values(29102900, 'https://www.onetonline.org/link/summary/29-1029.00', 'Dentists, All Other Specialists', 'Research, Development, Design, and Practitioners', 'All dentists not listed separately.');
INSERT INTO ONetJobs values(29102100, 'https://www.onetonline.org/link/summary/29-1021.00', 'Dentists, General', 'Research, Development, Design, and Practitioners', 'Examine, diagnose, and treat diseases, injuries, and malformations of teeth and gums. May treat diseases of nerve, pulp, and other dental tissues affecting oral hygiene and retention of teeth. May fit dental appliances or provide preventive care.');
INSERT INTO ONetJobs values(29121300, 'https://www.onetonline.org/link/summary/29-1213.00', 'Dermatologists', 'Research, Development, Design, and Practitioners', 'Diagnose and treat diseases relating to the skin, hair, and nails. May perform both medical and dermatological surgery functions.');
INSERT INTO ONetJobs values(29203200, 'https://www.onetonline.org/link/summary/29-2032.00', 'Diagnostic Medical Sonographers', 'Technologists and Technicians', 'Produce ultrasonic recordings of internal organs for use by physicians. Includes vascular technologists.');
INSERT INTO ONetJobs values(29205100, 'https://www.onetonline.org/link/summary/29-2051.00', 'Dietetic Technicians', 'Technologists and Technicians', 'Assist in the provision of food service and nutritional programs, under the supervision of a dietitian. May plan and produce meals based on established guidelines, teach principles of food and nutrition, or counsel individuals.');
INSERT INTO ONetJobs values(29103100, 'https://www.onetonline.org/link/summary/29-1031.00', 'Dietitians and Nutritionists', 'Research, Development, Design, and Practitioners', 'Plan and conduct food service or nutritional programs to assist in the promotion of health and control of disease. May supervise activities of a department providing quantity food services, counsel individuals, or conduct nutritional research.');
INSERT INTO ONetJobs values(15129906, 'https://www.onetonline.org/link/summary/15-1299.06', 'Digital Forensics Analysts', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Conduct investigations on computer-based crimes establishing documentary or physical evidence, such as digital media and logs associated with cyber intrusion incidents. Analyze digital evidence and investigate computer security incidents to derive information in support of system and network vulnerability mitigation. Preserve and present computer-related evidence in support of criminal, fraud, counterintelligence, or law enforcement investigations.');
INSERT INTO ONetJobs values(15129903, 'https://www.onetonline.org/link/summary/15-1299.03', 'Document Management Specialists', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Implement and administer enterprise-wide document management systems and related procedures that allow organizations to capture, store, retrieve, share, and destroy electronic records and documents.');
INSERT INTO ONetJobs values(17301900, 'https://www.onetonline.org/link/summary/17-3019.00', 'Drafters, All Other', 'Technologists and Technicians', 'All drafters not listed separately.');
INSERT INTO ONetJobs values(25106300, 'https://www.onetonline.org/link/summary/25-1063.00', 'Economics Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in economics. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(19301100, 'https://www.onetonline.org/link/summary/19-3011.00', 'Economists', 'Research, Development, Design, and Practitioners', 'Conduct research, prepare reports, or formulate plans to address economic problems related to the production and distribution of goods and services or monetary and fiscal policy. May collect and process economic and statistical data using sampling techniques and econometric methods.');
INSERT INTO ONetJobs values(17302300, 'https://www.onetonline.org/link/summary/17-3023.00', 'Electrical and Electronic Engineering Technologists and Technicians', 'Technologists and Technicians', 'Apply electrical and electronic theory and related knowledge, usually under the direction of engineering staff, to design, build, repair, adjust, and modify electrical components, circuitry, controls, and machinery for subsequent evaluation and use by engineering staff in making engineering design decisions.');
INSERT INTO ONetJobs values(17301200, 'https://www.onetonline.org/link/summary/17-3012.00', 'Electrical and Electronics Drafters', 'Technologists and Technicians', 'Prepare wiring diagrams, circuit board assembly diagrams, and layout drawings used for the manufacture, installation, or repair of electrical equipment.');
INSERT INTO ONetJobs values(17207100, 'https://www.onetonline.org/link/summary/17-2071.00', 'Electrical Engineers', 'Research, Development, Design, and Practitioners', 'Research, design, develop, test, or supervise the manufacturing and installation of electrical equipment, components, or systems for commercial, industrial, military, or scientific use.');
INSERT INTO ONetJobs values(17302400, 'https://www.onetonline.org/link/summary/17-3024.00', 'Electro-Mechanical and Mechatronics Technologists and Technicians', 'Technologists and Technicians', 'Operate, test, maintain, or adjust unmanned, automated, servomechanical, or electromechanical equipment. May operate unmanned submarines, aircraft, or other equipment to observe or record visual information at sites such as oil rigs, crop fields, buildings, or for similar infrastructure, deep ocean exploration, or hazardous waste removal. May assist engineers in testing and designing robotics equipment.');
INSERT INTO ONetJobs values(17207200, 'https://www.onetonline.org/link/summary/17-2072.00', 'Electronics Engineers, Except Computer', 'Research, Development, Design, and Practitioners', 'Research, design, develop, or test electronic components and systems for commercial, industrial, military, or scientific use employing knowledge of electronic theory and materials properties. Design electronic circuits and components for use in fields such as telecommunications, aerospace guidance and propulsion control, acoustics, or instruments and controls.');
INSERT INTO ONetJobs values(29204200, 'https://www.onetonline.org/link/summary/29-2042.00', 'Emergency Medical Technicians', 'Technologists and Technicians', 'Assess injuries and illnesses and administer basic emergency medical care. May transport injured or sick persons to medical facilities.');
INSERT INTO ONetJobs values(29121400, 'https://www.onetonline.org/link/summary/29-1214.00', 'Emergency Medicine Physicians', 'Research, Development, Design, and Practitioners', 'Make immediate medical decisions and act to prevent death or further disability. Provide immediate recognition, evaluation, care, stabilization, and disposition of patients. May direct emergency medical staff in an emergency department.');
INSERT INTO ONetJobs values(17219903, 'https://www.onetonline.org/link/summary/17-2199.03', 'Energy Engineers, Except Wind and Solar', 'Research, Development, Design, and Practitioners', 'Design, develop, or evaluate energy-related projects or programs to reduce energy costs or improve energy efficiency during the designing, building, or remodeling stages of construction. May specialize in electrical systems; heating, ventilation, and air-conditioning (HVAC) systems; green buildings; lighting; air quality; or energy procurement.');
INSERT INTO ONetJobs values(25103200, 'https://www.onetonline.org/link/summary/25-1032.00', 'Engineering Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses pertaining to the application of physical laws and principles of engineering for the development of machines, materials, instruments, processes, and services. Includes teachers of subjects such as chemical, civil, electrical, industrial, mechanical, mineral, and petroleum engineering. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(17302900, 'https://www.onetonline.org/link/summary/17-3029.00', 'Engineering Technologists and Technicians, Except Drafters, All Other', 'Technologists and Technicians', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(17219900, 'https://www.onetonline.org/link/summary/17-2199.00', 'Engineers, All Other', 'Research, Development, Design, and Practitioners', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(19301101, 'https://www.onetonline.org/link/summary/19-3011.01', 'Environmental Economists', 'Research, Development, Design, and Practitioners', 'Conduct economic analysis related to environmental protection and use of the natural environment, such as water, air, land, and renewable energy resources. Evaluate and quantify benefits, costs, incentives, and impacts of alternative options using economic principles and statistical techniques.');
INSERT INTO ONetJobs values(17302500, 'https://www.onetonline.org/link/summary/17-3025.00', 'Environmental Engineering Technologists and Technicians', 'Technologists and Technicians', 'Apply theory and principles of environmental engineering to modify, test, and operate equipment and devices used in the prevention, control, and remediation of environmental problems, including waste treatment and site remediation, under the direction of engineering staff or scientists. May assist in the development of environmental remediation devices.');
INSERT INTO ONetJobs values(17208100, 'https://www.onetonline.org/link/summary/17-2081.00', 'Environmental Engineers', 'Research, Development, Design, and Practitioners', 'Research, design, plan, or perform engineering duties in the prevention, control, and remediation of environmental hazards using various engineering disciplines. Work may include waste treatment, site remediation, or pollution control technology.');
INSERT INTO ONetJobs values(19204102, 'https://www.onetonline.org/link/summary/19-2041.02', 'Environmental Restoration Planners', 'Research, Development, Design, and Practitioners', 'Collaborate with field and biology staff to oversee the implementation of restoration projects and to develop new products. Process and synthesize complex scientific data into practical strategies for restoration, monitoring or management.');
INSERT INTO ONetJobs values(19404200, 'https://www.onetonline.org/link/summary/19-4042.00', 'Environmental Science and Protection Technicians, Including Health', 'Technologists and Technicians', 'Perform laboratory and field tests to monitor the environment and investigate sources of pollution, including those that affect health, under the direction of an environmental scientist, engineer, or other specialist. May collect samples of gases, soil, water, and other materials for testing.');
INSERT INTO ONetJobs values(25105300, 'https://www.onetonline.org/link/summary/25-1053.00', 'Environmental Science Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in environmental science. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(19204100, 'https://www.onetonline.org/link/summary/19-2041.00', 'Environmental Scientists and Specialists, Including Health', 'Research, Development, Design, and Practitioners', 'Conduct research or perform investigation for the purpose of identifying, abating, or eliminating sources of pollutants or hazards that affect either the environment or public health. Using knowledge of various scientific disciplines, may collect, synthesize, study, report, and recommend action based on data derived from measurements or observations of air, food, soil, water, and other sources.');
INSERT INTO ONetJobs values(19104100, 'https://www.onetonline.org/link/summary/19-1041.00', 'Epidemiologists', 'Research, Development, Design, and Practitioners', 'Investigate and describe the determinants and distribution of disease, disability, or health outcomes. May develop the means for prevention and control.');
INSERT INTO ONetJobs values(29112800, 'https://www.onetonline.org/link/summary/29-1128.00', 'Exercise Physiologists', 'Research, Development, Design, and Practitioners', 'Assess, plan, or implement fitness programs that include exercise or physical activities such as those designed to improve cardiorespiratory function, body composition, muscular strength, muscular endurance, or flexibility.');
INSERT INTO ONetJobs values(29121500, 'https://www.onetonline.org/link/summary/29-1215.00', 'Family Medicine Physicians', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, and provide preventive care to individuals and families across the lifespan. May refer patients to specialists when needed for further diagnosis or treatment.');
INSERT INTO ONetJobs values(17211102, 'https://www.onetonline.org/link/summary/17-2111.02', 'Fire-Prevention and Protection Engineers', 'Research, Development, Design, and Practitioners', 'Research causes of fires, determine fire protection methods, and design or recommend materials or equipment such as structural components or fire-detection equipment to assist organizations in safeguarding life and property against fire, explosion, and related hazards.');
INSERT INTO ONetJobs values(19401300, 'https://www.onetonline.org/link/summary/19-4013.00', 'Food Science Technicians', 'Technologists and Technicians', 'Work with food scientists or technologists to perform standardized qualitative and quantitative tests to determine physical or chemical properties of food or beverage products. Includes technicians who assist in research and development of production technology, quality control, packaging, processing, and use of foods.');
INSERT INTO ONetJobs values(19101200, 'https://www.onetonline.org/link/summary/19-1012.00', 'Food Scientists and Technologists', 'Research, Development, Design, and Practitioners', 'Use chemistry, microbiology, engineering, and other sciences to study the principles underlying the processing and deterioration of foods; analyze food content to determine levels of vitamins, fat, sugar, and protein; discover new food sources; research ways to make processed foods safe, palatable, and healthful; and apply food science knowledge to determine best ways to process, package, preserve, store, and distribute food.');
INSERT INTO ONetJobs values(19409200, 'https://www.onetonline.org/link/summary/19-4092.00', 'Forensic Science Technicians', 'Technologists and Technicians', 'Collect, identify, classify, and analyze physical evidence related to criminal investigations. Perform tests on weapons or substances, such as fiber, hair, and tissue to determine significance to investigation. May testify as expert witnesses on evidence or crime laboratory techniques. May serve as specialists in area of expertise, such as ballistics, fingerprinting, handwriting, or biochemistry.');
INSERT INTO ONetJobs values(19407100, 'https://www.onetonline.org/link/summary/19-4071.00', 'Forest and Conservation Technicians', 'Technologists and Technicians', 'Provide technical assistance regarding the conservation of soil, water, forests, or related natural resources. May compile data pertaining to size, content, condition, and other characteristics of forest tracts under the direction of foresters, or train and lead forest workers in forest propagation and fire prevention and suppression. May assist conservation scientists in managing, improving, and protecting rangelands and wildlife habitats.');
INSERT INTO ONetJobs values(19103200, 'https://www.onetonline.org/link/summary/19-1032.00', 'Foresters', 'Research, Development, Design, and Practitioners', 'Manage public and private forested lands for economic, recreational, and conservation purposes. May inventory the type, amount, and location of standing timber, appraise the timbers worth, negotiate the purchase, and draw up contracts for procurement. May determine how to conserve wildlife habitats, creek beds, water quality, and soil stability, and how best to comply with environmental regulations. May devise plans for planting and growing new trees, monitor trees for healthy growth, and determine optimal harvesting schedules.');
INSERT INTO ONetJobs values(25104300, 'https://www.onetonline.org/link/summary/25-1043.00', 'Forestry and Conservation Science Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in forestry and conservation science. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(17214101, 'https://www.onetonline.org/link/summary/17-2141.01', 'Fuel Cell Engineers', 'Research, Development, Design, and Practitioners', 'Design, evaluate, modify, or construct fuel cell components or systems for transportation, stationary, or portable applications.');
INSERT INTO ONetJobs values(29121600, 'https://www.onetonline.org/link/summary/29-1216.00', 'General Internal Medicine Physicians', 'Research, Development, Design, and Practitioners', 'Diagnose and provide nonsurgical treatment for a wide range of diseases and injuries of internal organ systems. Provide care mainly for adults and adolescents, and are based primarily in an outpatient care setting.');
INSERT INTO ONetJobs values(29909200, 'https://www.onetonline.org/link/summary/29-9092.00', 'Genetic Counselors', 'Research, Development, Design, and Practitioners', 'Assess individual or family risk for a variety of inherited conditions, such as genetic disorders and birth defects. Provide information to other healthcare providers or to individuals and families concerned with the risk of inherited conditions. Advise individuals and families to support informed decisionmaking and coping methods for those at risk. May help conduct research related to genetic conditions or genetic counseling.');
INSERT INTO ONetJobs values(19102903, 'https://www.onetonline.org/link/summary/19-1029.03', 'Geneticists', 'Research, Development, Design, and Practitioners', 'Research and study the inheritance of traits at the molecular, organism or population level. May evaluate or treat patients with genetic disorders.');
INSERT INTO ONetJobs values(17102201, 'https://www.onetonline.org/link/summary/17-1022.01', 'Geodetic Surveyors', 'Technologists and Technicians', 'Measure large areas of the Earths surface using satellite observations, global navigation satellite systems (GNSS), light detection and ranging (LIDAR), or related sources.');
INSERT INTO ONetJobs values(19309200, 'https://www.onetonline.org/link/summary/19-3092.00', 'Geographers', 'Research, Development, Design, and Practitioners', 'Study the nature and use of areas of the Earths surface, relating and interpreting interactions of physical and cultural phenomena. Conduct research on physical aspects of a region, including land forms, climates, soils, plants, and animals, and conduct research on the spatial implications of human activities within a given area, including social characteristics, economic activities, and political organization, as well as researching interdependence between regions at scales ranging from local to global.');
INSERT INTO ONetJobs values(15129902, 'https://www.onetonline.org/link/summary/15-1299.02', 'Geographic Information Systems Technologists and Technicians', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Assist scientists or related professionals in building, maintaining, modifying, or using geographic information systems (GIS) databases. May also perform some custom application development or provide user support.');
INSERT INTO ONetJobs values(25106400, 'https://www.onetonline.org/link/summary/25-1064.00', 'Geography Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in geography. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(19404300, 'https://www.onetonline.org/link/summary/19-4043.00', 'Geological Technicians, Except Hydrologic Technicians', 'Technologists and Technicians', 'Assist scientists or engineers in the use of electronic, sonic, or nuclear measuring instruments in laboratory, exploration, and production activities to obtain data indicating resources such as metallic ore, minerals, gas, coal, or petroleum. Analyze mud and drill cuttings. Chart pressure, temperature, and other characteristics of wells or bore holes.');
INSERT INTO ONetJobs values(19204200, 'https://www.onetonline.org/link/summary/19-2042.00', 'Geoscientists, Except Hydrologists and Geographers', 'Research, Development, Design, and Practitioners', 'Study the composition, structure, and other physical aspects of the Earth. May use geological, physics, and mathematics knowledge in exploration for oil, gas, minerals, or underground water; or in waste disposal, land reclamation, or other environmental problems. May study the Earths internal composition, atmospheres, and oceans, and its magnetic, electrical, and gravitational forces. Includes mineralogists, paleontologists, stratigraphers, geodesists, and seismologists.');
INSERT INTO ONetJobs values(17211100, 'https://www.onetonline.org/link/summary/17-2111.00', 'Health and Safety Engineers, Except Mining Safety Engineers and Inspectors', 'Research, Development, Design, and Practitioners', 'Promote worksite or product safety by applying knowledge of industrial processes, mechanics, chemistry, psychology, and industrial health and safety laws. Includes industrial product safety engineers.');
INSERT INTO ONetJobs values(15121101, 'https://www.onetonline.org/link/summary/15-1211.01', 'Health Informatics Specialists', 'Research, Development, Design, and Practitioners', 'Apply knowledge of nursing and informatics to assist in the design, development, and ongoing modification of computerized health care systems. May educate staff and assist in problem solving to promote the implementation of the health care system.');
INSERT INTO ONetJobs values(29902100, 'https://www.onetonline.org/link/summary/29-9021.00', 'Health Information Technologists and Medical Registrars', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Apply knowledge of healthcare and information systems to assist in the design, development, and continued modification and analysis of computerized healthcare systems. Abstract, collect, and analyze treatment and followup information of patients. May educate staff and assist in problem solving to promote the implementation of the healthcare information system. May design, develop, test, and implement databases with complete history, diagnosis, treatment, and health status to help monitor diseases.');
INSERT INTO ONetJobs values(25107100, 'https://www.onetonline.org/link/summary/25-1071.00', 'Health Specialties Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in health specialties, in fields such as dentistry, laboratory technology, medicine, pharmacy, public health, therapy, and veterinary medicine.');
INSERT INTO ONetJobs values(29209900, 'https://www.onetonline.org/link/summary/29-2099.00', 'Health Technologists and Technicians, All Other', 'Technologists and Technicians', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(29129900, 'https://www.onetonline.org/link/summary/29-1299.00', 'Healthcare Diagnosing or Treating Practitioners, All Other', 'Research, Development, Design, and Practitioners', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(29909900, 'https://www.onetonline.org/link/summary/29-9099.00', 'Healthcare Practitioners and Technical Workers, All Other', 'Research, Development, Design, and Practitioners; Technologists and Technicians', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(29209200, 'https://www.onetonline.org/link/summary/29-2092.00', 'Hearing Aid Specialists', 'Technologists and Technicians', 'Select and fit hearing aids for customers. Administer and interpret tests of hearing. Assess hearing instrument efficacy. Take ear impressions and prepare, design, and modify ear molds.');
INSERT INTO ONetJobs values(29201201, 'https://www.onetonline.org/link/summary/29-2012.01', 'Histology Technicians', 'Technologists and Technicians', 'Prepare histological slides from tissue sections for microscopic examination and diagnosis by pathologists. May assist with research studies.');
INSERT INTO ONetJobs values(29201104, 'https://www.onetonline.org/link/summary/29-2011.04', 'Histotechnologists', 'Technologists and Technicians', 'Apply knowledge of health and disease causes to evaluate new laboratory techniques and procedures to examine tissue samples. Process and prepare histological slides from tissue sections for microscopic examination and diagnosis by pathologists. May solve technical or instrument problems or assist with research studies.');
INSERT INTO ONetJobs values(29122902, 'https://www.onetonline.org/link/summary/29-1229.02', 'Hospitalists', 'Research, Development, Design, and Practitioners', 'Provide inpatient care predominantly in settings such as medical wards, acute care units, intensive care units, rehabilitation centers, or emergency rooms. Manage and coordinate patient care throughout treatment.');
INSERT INTO ONetJobs values(17211201, 'https://www.onetonline.org/link/summary/17-2112.01', 'Human Factors Engineers and Ergonomists', 'Research, Development, Design, and Practitioners', 'Design objects, facilities, and environments to optimize human well-being and overall system performance, applying theory, principles, and data regarding the relationship between humans and respective technology. Investigate and analyze characteristics of human behavior and performance as it relates to the use of technology.');
INSERT INTO ONetJobs values(19404400, 'https://www.onetonline.org/link/summary/19-4044.00', 'Hydrologic Technicians', 'Technologists and Technicians', 'Collect and organize data concerning the distribution and circulation of ground and surface water, and data on its physical, chemical, and biological properties. Measure and report on flow rates and ground water levels, maintain field equipment, collect water samples, install and collect sampling equipment, and process samples for shipment to testing laboratories. May collect data on behalf of hydrologists, engineers, developers, government agencies, or agriculture.');
INSERT INTO ONetJobs values(19204300, 'https://www.onetonline.org/link/summary/19-2043.00', 'Hydrologists', 'Research, Development, Design, and Practitioners', 'Research the distribution, circulation, and physical properties of underground and surface waters; and study the form and intensity of precipitation and its rate of infiltration into the soil, movement through the earth, and return to the ocean and atmosphere.');
INSERT INTO ONetJobs values(19204103, 'https://www.onetonline.org/link/summary/19-2041.03', 'Industrial Ecologists', 'Research, Development, Design, and Practitioners', 'Apply principles and processes of natural ecosystems to develop models for efficient industrial systems. Use knowledge from the physical and social sciences to maximize effective use of natural resources in the production and use of goods and services. Examine societal issues and their relationship with both technical systems and the environment.');
INSERT INTO ONetJobs values(17302600, 'https://www.onetonline.org/link/summary/17-3026.00', 'Industrial Engineering Technologists and Technicians', 'Technologists and Technicians', 'Apply engineering theory and principles to problems of industrial layout or manufacturing production, usually under the direction of engineering staff. May perform time and motion studies on worker operations in a variety of industries for purposes such as establishing standard production rates or improving efficiency.');
INSERT INTO ONetJobs values(17211200, 'https://www.onetonline.org/link/summary/17-2112.00', 'Industrial Engineers', 'Research, Development, Design, and Practitioners', 'Design, develop, test, and evaluate integrated systems for managing industrial production processes, including human work factors, quality control, inventory control, logistics and material flow, cost analysis, and production coordination.');
INSERT INTO ONetJobs values(19303200, 'https://www.onetonline.org/link/summary/19-3032.00', 'Industrial-Organizational Psychologists', 'Research, Development, Design, and Practitioners', 'Apply principles of psychology to human resources, administration, management, sales, and marketing problems. Activities may include policy planning; employee testing and selection, training, and development; and organizational development and analysis. May work with management to organize the work setting to improve worker productivity.');
INSERT INTO ONetJobs values(15121200, 'https://www.onetonline.org/link/summary/15-1212.00', 'Information Security Analysts', 'Research, Development, Design, and Practitioners', 'Plan, implement, upgrade, or monitor security measures for the protection of computer networks and information. Assess system vulnerabilities for security risks and propose and implement risk mitigation strategies. May ensure appropriate security controls are in place that will safeguard digital files and vital electronic infrastructure. May respond to computer security breaches and viruses.');
INSERT INTO ONetJobs values(15129905, 'https://www.onetonline.org/link/summary/15-1299.05', 'Information Security Engineers', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Develop and oversee the implementation of information security procedures and policies. Build, maintain and upgrade security technology, such as firewalls, for the safe use of computer networks and the transmission and retrieval of information. Design and implement appropriate security controls to identify vulnerabilities and protect digital files and electronic infrastructures. Monitor and respond to computer security breaches, viruses, and intrusions, and perform forensic investigation. May oversee the assessment of information security systems.');
INSERT INTO ONetJobs values(15129909, 'https://www.onetonline.org/link/summary/15-1299.09', 'Information Technology Project Managers', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Plan, initiate, and manage information technology (IT) projects. Lead and guide the work of technical staff. Serve as liaison between business and technical aspects of projects. Plan project stages and assess business implications for each stage. Monitor progress to assure deadlines, standards, and cost targets are met.');
INSERT INTO ONetJobs values(17101200, 'https://www.onetonline.org/link/summary/17-1012.00', 'Landscape Architects', 'Research, Development, Design, and Practitioners', 'Plan and design land areas for projects such as parks and other recreational facilities, airports, highways, hospitals, schools, land subdivisions, and commercial, industrial, and residential sites.');
INSERT INTO ONetJobs values(29206100, 'https://www.onetonline.org/link/summary/29-2061.00', 'Licensed Practical and Licensed Vocational Nurses', 'Technologists and Technicians', 'Care for ill, injured, or convalescing patients or persons with disabilities in hospitals, nursing homes, clinics, private homes, group homes, and similar institutions. May work under the supervision of a registered nurse. Licensing required.');
INSERT INTO ONetJobs values(19109900, 'https://www.onetonline.org/link/summary/19-1099.00', 'Life Scientists, All Other', 'Research, Development, Design, and Practitioners', 'All life scientists not listed separately.');
INSERT INTO ONetJobs values(19409900, 'https://www.onetonline.org/link/summary/19-4099.00', 'Life, Physical, and Social Science Technicians, All Other', 'Technologists and Technicians', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(29112201, 'https://www.onetonline.org/link/summary/29-1122.01', 'Low Vision Therapists, Orientation and Mobility Specialists, and Vision Rehabilitation Therapists', 'Research, Development, Design, and Practitioners', 'Provide therapy to patients with visual impairments to improve their functioning in daily life activities. May train patients in activities such as computer use, communication skills, or home management skills.');
INSERT INTO ONetJobs values(29203500, 'https://www.onetonline.org/link/summary/29-2035.00', 'Magnetic Resonance Imaging Technologists', 'Technologists and Technicians', 'Operate Magnetic Resonance Imaging (MRI) scanners. Monitor patient safety and comfort, and view images of area being scanned to ensure quality of pictures. May administer gadolinium contrast dosage intravenously. May interview patient, explain MRI procedures, and position patient on examining table. May enter into the computer data such as patient history, anatomical area to be scanned, orientation specified, and position of entry.');
INSERT INTO ONetJobs values(17211203, 'https://www.onetonline.org/link/summary/17-2112.03', 'Manufacturing Engineers', 'Research, Development, Design, and Practitioners', 'Design, integrate, or improve manufacturing systems or related processes. May work with commercial or industrial designers to refine product designs to increase producibility and decrease costs.');
INSERT INTO ONetJobs values(17212100, 'https://www.onetonline.org/link/summary/17-2121.00', 'Marine Engineers and Naval Architects', 'Research, Development, Design, and Practitioners', 'Design, develop, and evaluate the operation of marine vessels, ship machinery, and related equipment, such as power supply and propulsion systems.');
INSERT INTO ONetJobs values(17213100, 'https://www.onetonline.org/link/summary/17-2131.00', 'Materials Engineers', 'Research, Development, Design, and Practitioners', 'Evaluate materials and develop machinery and processes to manufacture materials for use in products that must meet specialized design and performance specifications. Develop new uses for known materials. Includes those engineers working with composite materials or specializing in one type of material, such as graphite, metal and metal alloys, ceramics and glass, plastics and polymers, and naturally occurring materials. Includes metallurgists and metallurgical engineers, ceramic engineers, and welding engineers.');
INSERT INTO ONetJobs values(19203200, 'https://www.onetonline.org/link/summary/19-2032.00', 'Materials Scientists', 'Research, Development, Design, and Practitioners', 'Research and study the structures and chemical properties of various natural and synthetic or composite materials, including metals, alloys, rubber, ceramics, semiconductors, polymers, and glass. Determine ways to strengthen or combine materials or develop new materials with new or specific properties for use in a variety of products and applications. Includes glass scientists, ceramic scientists, metallurgical scientists, and polymer scientists.');
INSERT INTO ONetJobs values(15209900, 'https://www.onetonline.org/link/summary/15-2099.00', 'Mathematical Science Occupations, All Other', 'Research, Development, Design, and Practitioners; Technologists and Technicians', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(25102200, 'https://www.onetonline.org/link/summary/25-1022.00', 'Mathematical Science Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses pertaining to mathematical concepts, statistics, and actuarial science and to the application of original and standardized mathematical techniques in solving specific problems and situations. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(15202100, 'https://www.onetonline.org/link/summary/15-2021.00', 'Mathematicians', 'Research, Development, Design, and Practitioners', 'Conduct research in fundamental mathematics or in application of mathematical techniques to science, management, and other fields. Solve problems in various fields using mathematical methods.');
INSERT INTO ONetJobs values(17301300, 'https://www.onetonline.org/link/summary/17-3013.00', 'Mechanical Drafters', 'Technologists and Technicians', 'Prepare detailed working diagrams of machinery and mechanical devices, including dimensions, fastening methods, and other engineering information.');
INSERT INTO ONetJobs values(17302700, 'https://www.onetonline.org/link/summary/17-3027.00', 'Mechanical Engineering Technologists and Technicians', 'Technologists and Technicians', 'Apply theory and principles of mechanical engineering to modify, develop, test, or adjust machinery and equipment under direction of engineering staff or physical scientists.');
INSERT INTO ONetJobs values(17214100, 'https://www.onetonline.org/link/summary/17-2141.00', 'Mechanical Engineers', 'Research, Development, Design, and Practitioners', 'Perform engineering duties in planning and designing tools, engines, machines, and other mechanically functioning equipment. Oversee installation, operation, maintenance, and repair of equipment such as centralized heat, gas, water, and steam systems.');
INSERT INTO ONetJobs values(17219905, 'https://www.onetonline.org/link/summary/17-2199.05', 'Mechatronics Engineers', 'Research, Development, Design, and Practitioners', 'Research, design, develop, or test automation, intelligent systems, smart devices, or industrial systems control.');
INSERT INTO ONetJobs values(29201200, 'https://www.onetonline.org/link/summary/29-2012.00', 'Medical and Clinical Laboratory Technicians', 'Technologists and Technicians', 'Perform routine medical laboratory tests for the diagnosis, treatment, and prevention of disease. May work under the supervision of a medical technologist.');
INSERT INTO ONetJobs values(29201100, 'https://www.onetonline.org/link/summary/29-2011.00', 'Medical and Clinical Laboratory Technologists', 'Technologists and Technicians', 'Perform complex medical laboratory tests for diagnosis, treatment, and prevention of disease. May train or supervise staff.');
INSERT INTO ONetJobs values(11911100, 'https://www.onetonline.org/link/summary/11-9111.00', 'Medical and Health Services Managers', 'Managerial', 'Plan, direct, or coordinate medical and health services in hospitals, clinics, managed care organizations, public health agencies, or similar organizations.');
INSERT INTO ONetJobs values(29203600, 'https://www.onetonline.org/link/summary/29-2036.00', 'Medical Dosimetrists', 'Technologists and Technicians', 'Generate radiation treatment plans, develop radiation dose calculations, communicate and supervise the treatment plan implementation, and consult with members of radiation oncology team.');
INSERT INTO ONetJobs values(29207200, 'https://www.onetonline.org/link/summary/29-2072.00', 'Medical Records Specialists', 'Technologists and Technicians', 'Compile, process, and maintain medical records of hospital and clinic patients in a manner consistent with medical, administrative, ethical, legal, and regulatory requirements of the healthcare system. Classify medical and healthcare concepts, including diagnosis, procedures, medical services, and equipment, into the healthcare industrys numerical coding system. Includes medical coders.');
INSERT INTO ONetJobs values(19104200, 'https://www.onetonline.org/link/summary/19-1042.00', 'Medical Scientists, Except Epidemiologists', 'Research, Development, Design, and Practitioners', 'Conduct research dealing with the understanding of human diseases and the improvement of human health. Engage in clinical investigation, research and development, or other related activities.');
INSERT INTO ONetJobs values(19102200, 'https://www.onetonline.org/link/summary/19-1022.00', 'Microbiologists', 'Research, Development, Design, and Practitioners', 'Investigate the growth, structure, development, and other characteristics of microscopic organisms, such as bacteria, algae, or fungi. Includes medical microbiologists who study the relationship between organisms and disease or the effects of antibiotics on microorganisms.');
INSERT INTO ONetJobs values(17219906, 'https://www.onetonline.org/link/summary/17-2199.06', 'Microsystems Engineers', 'Research, Development, Design, and Practitioners', 'Research, design, develop, or test microelectromechanical systems (MEMS) devices.');
INSERT INTO ONetJobs values(29909901, 'https://www.onetonline.org/link/summary/29-9099.01', 'Midwives', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Provide prenatal care and childbirth assistance.');
INSERT INTO ONetJobs values(17215100, 'https://www.onetonline.org/link/summary/17-2151.00', 'Mining and Geological Engineers, Including Mining Safety Engineers', 'Research, Development, Design, and Practitioners', 'Conduct subsurface surveys to identify the characteristics of potential land or mining development sites. May specify the ground support systems, processes, and equipment for safe, economical, and environmentally sound extraction or underground construction activities. May inspect areas for unsafe geological conditions, equipment, and working conditions. May design, implement, and coordinate mine safety programs.');
INSERT INTO ONetJobs values(19102902, 'https://www.onetonline.org/link/summary/19-1029.02', 'Molecular and Cellular Biologists', 'Research, Development, Design, and Practitioners', 'Research and study cellular molecules and organelles to understand cell function and organization.');
INSERT INTO ONetJobs values(29112902, 'https://www.onetonline.org/link/summary/29-1129.02', 'Music Therapists', 'Research, Development, Design, and Practitioners', 'Plan, organize, direct, or assess clinical and evidenced-based music therapy interventions to positively influence individuals physical, psychological, cognitive, or behavioral status.');
INSERT INTO ONetJobs values(17219909, 'https://www.onetonline.org/link/summary/17-2199.09', 'Nanosystems Engineers', 'Research, Development, Design, and Practitioners', 'Design, develop, or supervise the production of materials, devices, or systems of unique molecular or macromolecular composition, applying principles of nanoscale physics and electrical, chemical, or biological engineering.');
INSERT INTO ONetJobs values(17302601, 'https://www.onetonline.org/link/summary/17-3026.01', 'Nanotechnology Engineering Technologists and Technicians', 'Technologists and Technicians', 'Implement production processes and operate commercial-scale production equipment to produce, test, or modify materials, devices, or systems of unique molecular or macromolecular composition. Operate advanced microscopy equipment to manipulate nanoscale objects. Work under the supervision of nanoengineering staff.');
INSERT INTO ONetJobs values(11912100, 'https://www.onetonline.org/link/summary/11-9121.00', 'Natural Sciences Managers', 'Managerial', 'Plan, direct, or coordinate activities in such fields as life sciences, physical sciences, mathematics, statistics, and research and development in these fields.');
INSERT INTO ONetJobs values(29129901, 'https://www.onetonline.org/link/summary/29-1299.01', 'Naturopathic Physicians', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, and help prevent diseases using a system of practice that is based on the natural healing capacity of individuals. May use physiological, psychological or mechanical methods. May also use natural medicines, prescription or legend drugs, foods, herbs, or other natural remedies.');
INSERT INTO ONetJobs values(15124400, 'https://www.onetonline.org/link/summary/15-1244.00', 'Network and Computer Systems Administrators', 'Research, Development, Design, and Practitioners', 'Install, configure, and maintain an organizations local area network (LAN), wide area network (WAN), data communications network, operating systems, and physical and virtual servers. Perform system monitoring and verify the integrity and availability of hardware, network, and server resources and systems. Review system and application logs and verify completion of scheduled jobs, including system backups. Analyze network and server resource consumption and control user access. Install and upgrade software and maintain software licenses. May assist in network modeling, analysis, planning, and coordination between network and data communications hardware and software.');
INSERT INTO ONetJobs values(29209901, 'https://www.onetonline.org/link/summary/29-2099.01', 'Neurodiagnostic Technologists', 'Technologists and Technicians', 'Conduct electroneurodiagnostic (END) tests such as electroencephalograms, evoked potentials, polysomnograms, or electronystagmograms. May perform nerve conduction studies.');
INSERT INTO ONetJobs values(29121700, 'https://www.onetonline.org/link/summary/29-1217.00', 'Neurologists', 'Research, Development, Design, and Practitioners', 'Diagnose, manage, and treat disorders and diseases of the brain, spinal cord, and peripheral nerves, with a primarily nonsurgical focus.');
INSERT INTO ONetJobs values(19303902, 'https://www.onetonline.org/link/summary/19-3039.02', 'Neuropsychologists', 'Research, Development, Design, and Practitioners', 'Apply theories and principles of neuropsychology to evaluate and diagnose disorders of higher cerebral functioning, often in research and medical settings. Study the human brain and the effect of physiological states on human cognition and behavior. May formulate and administer programs of treatment.');
INSERT INTO ONetJobs values(17302901, 'https://www.onetonline.org/link/summary/17-3029.01', 'Non-Destructive Testing Specialists', 'Technologists and Technicians', 'Test the safety of structures, vehicles, or vessels using x-ray, ultrasound, fiber optic or related equipment.');
INSERT INTO ONetJobs values(17216100, 'https://www.onetonline.org/link/summary/17-2161.00', 'Nuclear Engineers', 'Research, Development, Design, and Practitioners', 'Conduct research on nuclear engineering projects or apply principles and theory of nuclear science to problems concerned with release, control, and use of nuclear energy and nuclear waste disposal.');
INSERT INTO ONetJobs values(29203300, 'https://www.onetonline.org/link/summary/29-2033.00', 'Nuclear Medicine Technologists', 'Technologists and Technicians', 'Prepare, administer, and measure radioactive isotopes in therapeutic, diagnostic, and tracer studies using a variety of radioisotope equipment. Prepare stock solutions of radioactive materials and calculate doses to be administered by radiologists. Subject patients to radiation. Execute blood volume, red cell survival, and fat absorption studies following standard laboratory techniques.');
INSERT INTO ONetJobs values(19405102, 'https://www.onetonline.org/link/summary/19-4051.02', 'Nuclear Monitoring Technicians', 'Technologists and Technicians', 'Collect and test samples to monitor results of nuclear experiments and contamination of humans, facilities, and environment.');
INSERT INTO ONetJobs values(19405100, 'https://www.onetonline.org/link/summary/19-4051.00', 'Nuclear Technicians', 'Technologists and Technicians', 'Assist nuclear physicists, nuclear engineers, or other scientists in laboratory, power generation, or electricity production activities. May operate, maintain, or provide quality control for nuclear testing and research equipment. May monitor radiation.');
INSERT INTO ONetJobs values(29115100, 'https://www.onetonline.org/link/summary/29-1151.00', 'Nurse Anesthetists', 'Research, Development, Design, and Practitioners', 'Administer anesthesia, monitor patients vital signs, and oversee patient recovery from anesthesia. May assist anesthesiologists, surgeons, other physicians, or dentists. Must be registered nurses who have specialized graduate education.');
INSERT INTO ONetJobs values(29116100, 'https://www.onetonline.org/link/summary/29-1161.00', 'Nurse Midwives', 'Research, Development, Design, and Practitioners', 'Diagnose and coordinate all aspects of the birthing process, either independently or as part of a healthcare team. May provide well-woman gynecological care. Must have specialized, graduate nursing education.');
INSERT INTO ONetJobs values(29117100, 'https://www.onetonline.org/link/summary/29-1171.00', 'Nurse Practitioners', 'Research, Development, Design, and Practitioners', 'Diagnose and treat acute, episodic, or chronic illness, independently or as part of a healthcare team. May focus on health promotion and disease prevention. May order, perform, or interpret diagnostic tests such as lab work and x rays. May prescribe medication. Must be registered nurses who have specialized graduate education.');
INSERT INTO ONetJobs values(25107200, 'https://www.onetonline.org/link/summary/25-1072.00', 'Nursing Instructors and Teachers, Postsecondary', 'Postsecondary Teaching', 'Demonstrate and teach patient care in classroom and clinical units to nursing students. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(29121800, 'https://www.onetonline.org/link/summary/29-1218.00', 'Obstetricians and Gynecologists', 'Research, Development, Design, and Practitioners', 'Provide medical care related to pregnancy or childbirth. Diagnose, treat, and help prevent diseases of women, particularly those affecting the reproductive system. May also provide general care to women. May perform both medical and gynecological surgery functions.');
INSERT INTO ONetJobs values(29112200, 'https://www.onetonline.org/link/summary/29-1122.00', 'Occupational Therapists', 'Research, Development, Design, and Practitioners', 'Assess, plan, and organize rehabilitative programs that help build or restore vocational, homemaking, and daily living skills, as well as general independence, to persons with disabilities or developmental delays. Use therapeutic techniques, adapt the individuals environment, teach skills, and modify specific tasks that present barriers to the individual.');
INSERT INTO ONetJobs values(15203100, 'https://www.onetonline.org/link/summary/15-2031.00', 'Operations Research Analysts', 'Research, Development, Design, and Practitioners', 'Formulate and apply mathematical modeling and other optimizing methods to develop and interpret information that assists management with decisionmaking, policy formulation, or other managerial functions. May collect and analyze data and develop decision support software, services, or products. May develop and supply optimal time, cost, or logistics networks for program evaluation, review, or implementation.');
INSERT INTO ONetJobs values(29205700, 'https://www.onetonline.org/link/summary/29-2057.00', 'Ophthalmic Medical Technicians', 'Technologists and Technicians', 'Assist ophthalmologists by performing ophthalmic clinical functions. May administer eye exams, administer eye medications, and instruct the patient in care and use of corrective lenses.');
INSERT INTO ONetJobs values(29209905, 'https://www.onetonline.org/link/summary/29-2099.05', 'Ophthalmic Medical Technologists', 'Technologists and Technicians', 'Assist ophthalmologists by performing ophthalmic clinical functions and ophthalmic photography. Provide instruction and supervision to other ophthalmic personnel. Assist with minor surgical procedures, applying aseptic techniques and preparing instruments. May perform eye exams, administer eye medications, and instruct patients in care and use of corrective lenses.');
INSERT INTO ONetJobs values(29124100, 'https://www.onetonline.org/link/summary/29-1241.00', 'Ophthalmologists, Except Pediatric', 'Research, Development, Design, and Practitioners', 'Diagnose and perform surgery to treat and help prevent disorders and diseases of the eye. May also provide vision services for treatment including glasses and contacts.');
INSERT INTO ONetJobs values(29208100, 'https://www.onetonline.org/link/summary/29-2081.00', 'Opticians, Dispensing', 'Technologists and Technicians', 'Design, measure, fit, and adapt lenses and frames for client according to written optical prescription or specification. Assist client with inserting, removing, and caring for contact lenses. Assist client with selecting frames. Measure customer for size of eyeglasses and coordinate frames with facial and eye measurements and optical prescription. Prepare work order for optical laboratory containing instructions for grinding and mounting lenses in frames. Verify exactness of finished lens spectacles. Adjust frame and lens position to fit client. May shape or reshape frames. Includes contact lens opticians.');
INSERT INTO ONetJobs values(29104100, 'https://www.onetonline.org/link/summary/29-1041.00', 'Optometrists', 'Research, Development, Design, and Practitioners', 'Diagnose, manage, and treat conditions and diseases of the human eye and visual system. Examine eyes and visual system, diagnose problems or impairments, prescribe corrective lenses, and provide treatment. May prescribe therapeutic drugs to treat specific eye conditions.');
INSERT INTO ONetJobs values(29102200, 'https://www.onetonline.org/link/summary/29-1022.00', 'Oral and Maxillofacial Surgeons', 'Research, Development, Design, and Practitioners', 'Perform surgery and related procedures on the hard and soft tissues of the oral and maxillofacial regions to treat diseases, injuries, or defects. May diagnose problems of the oral and maxillofacial regions. May perform surgery to improve function or appearance.');
INSERT INTO ONetJobs values(29102300, 'https://www.onetonline.org/link/summary/29-1023.00', 'Orthodontists', 'Research, Development, Design, and Practitioners', 'Examine, diagnose, and treat dental malocclusions and oral cavity anomalies. Design and fabricate appliances to realign teeth and jaws to produce and maintain normal function and to improve appearance.');
INSERT INTO ONetJobs values(29124200, 'https://www.onetonline.org/link/summary/29-1242.00', 'Orthopedic Surgeons, Except Pediatric', 'Research, Development, Design, and Practitioners', 'Diagnose and perform surgery to treat and prevent rheumatic and other diseases in the musculoskeletal system.');
INSERT INTO ONetJobs values(29129902, 'https://www.onetonline.org/link/summary/29-1299.02', 'Orthoptists', 'Research, Development, Design, and Practitioners', 'Diagnose and treat visual system disorders such as binocular vision and eye movement impairments.');
INSERT INTO ONetJobs values(29209100, 'https://www.onetonline.org/link/summary/29-2091.00', 'Orthotists and Prosthetists', 'Technologists and Technicians', 'Design, measure, fit, and adapt orthopedic braces, appliances or prostheses, such as limbs or facial parts for patients with disabling conditions.');
INSERT INTO ONetJobs values(29204300, 'https://www.onetonline.org/link/summary/29-2043.00', 'Paramedics', 'Technologists and Technicians', 'Administer basic or advanced emergency medical care and assess injuries and illnesses. May administer medication intravenously, use equipment such as EKGs, or administer advanced life support to sick or injured individuals.');
INSERT INTO ONetJobs values(19103103, 'https://www.onetonline.org/link/summary/19-1031.03', 'Park Naturalists', 'Research, Development, Design, and Practitioners', 'Plan, develop, and conduct programs to inform public of historical, natural, and scientific features of national, state, or local park.');
INSERT INTO ONetJobs values(29209908, 'https://www.onetonline.org/link/summary/29-2099.08', 'Patient Representatives', 'Technologists and Technicians', 'Assist patients in obtaining services, understanding policies and making health care decisions.');
INSERT INTO ONetJobs values(29124300, 'https://www.onetonline.org/link/summary/29-1243.00', 'Pediatric Surgeons', 'Research, Development, Design, and Practitioners', 'Diagnose and perform surgery to treat fetal abnormalities and birth defects, diseases, and injuries in fetuses, premature and newborn infants, children, and adolescents. Includes all pediatric surgical specialties and subspecialties.');
INSERT INTO ONetJobs values(29122100, 'https://www.onetonline.org/link/summary/29-1221.00', 'Pediatricians, General', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, and help prevent diseases and injuries in children. May refer patients to specialists for further diagnosis or treatment, as needed.');
INSERT INTO ONetJobs values(15129904, 'https://www.onetonline.org/link/summary/15-1299.04', 'Penetration Testers', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Evaluate network system security by conducting simulated internal and external cyberattacks using adversary tools and techniques. Attempt to breach and exploit critical systems and gain access to sensitive information to assess system security.');
INSERT INTO ONetJobs values(17217100, 'https://www.onetonline.org/link/summary/17-2171.00', 'Petroleum Engineers', 'Research, Development, Design, and Practitioners', 'Devise methods to improve oil and gas extraction and production and determine the need for new or modified tool designs. Oversee drilling and offer technical advice.');
INSERT INTO ONetJobs values(29105100, 'https://www.onetonline.org/link/summary/29-1051.00', 'Pharmacists', 'Research, Development, Design, and Practitioners', 'Dispense drugs prescribed by physicians and other health practitioners and provide information to patients about medications and their use. May advise physicians and other health practitioners on the selection, dosage, interactions, and side effects of medications.');
INSERT INTO ONetJobs values(29205200, 'https://www.onetonline.org/link/summary/29-2052.00', 'Pharmacy Technicians', 'Technologists and Technicians', 'Prepare medications under the direction of a pharmacist. May measure, mix, count out, label, and record amounts and dosages of medications according to prescription orders.');
INSERT INTO ONetJobs values(17219907, 'https://www.onetonline.org/link/summary/17-2199.07', 'Photonics Engineers', 'Research, Development, Design, and Practitioners', 'Design technologies specializing in light information or light energy, such as laser or fiber optics technology.');
INSERT INTO ONetJobs values(17302908, 'https://www.onetonline.org/link/summary/17-3029.08', 'Photonics Technicians', 'Technologists and Technicians', 'Build, install, test, or maintain optical or fiber optic equipment, such as lasers, lenses, or mirrors, using spectrometers, interferometers, or related equipment.');
INSERT INTO ONetJobs values(29122904, 'https://www.onetonline.org/link/summary/29-1229.04', 'Physical Medicine and Rehabilitation Physicians', 'Research, Development, Design, and Practitioners', 'Diagnose and treat disorders requiring physiotherapy to provide physical, mental, and occupational rehabilitation.');
INSERT INTO ONetJobs values(19209900, 'https://www.onetonline.org/link/summary/19-2099.00', 'Physical Scientists, All Other', 'Research, Development, Design, and Practitioners', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(29112300, 'https://www.onetonline.org/link/summary/29-1123.00', 'Physical Therapists', 'Research, Development, Design, and Practitioners', 'Assess, plan, organize, and participate in rehabilitative programs that improve mobility, relieve pain, increase strength, and improve or correct disabling conditions resulting from disease or injury.');
INSERT INTO ONetJobs values(29107100, 'https://www.onetonline.org/link/summary/29-1071.00', 'Physician Assistants', 'Research, Development, Design, and Practitioners', 'Provide healthcare services typically performed by a physician, under the supervision of a physician. Conduct complete physicals, provide treatment, and counsel patients. May, in some cases, prescribe medication. Must graduate from an accredited educational program for physician assistants.');
INSERT INTO ONetJobs values(29122900, 'https://www.onetonline.org/link/summary/29-1229.00', 'Physicians, All Other', 'Research, Development, Design, and Practitioners', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(29122200, 'https://www.onetonline.org/link/summary/29-1222.00', 'Physicians, Pathologists', 'Research, Development, Design, and Practitioners', 'Diagnose diseases and conduct lab tests using organs, body tissues, and fluids. Includes medical examiners.');
INSERT INTO ONetJobs values(19201200, 'https://www.onetonline.org/link/summary/19-2012.00', 'Physicists', 'Research, Development, Design, and Practitioners', 'Conduct research into physical phenomena, develop theories on the basis of observation and experiments, and devise methods to apply physical laws and theories.');
INSERT INTO ONetJobs values(25105400, 'https://www.onetonline.org/link/summary/25-1054.00', 'Physics Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses pertaining to the laws of matter and energy. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(29108100, 'https://www.onetonline.org/link/summary/29-1081.00', 'Podiatrists', 'Research, Development, Design, and Practitioners', 'Diagnose and treat diseases and deformities of the human foot.');
INSERT INTO ONetJobs values(25106500, 'https://www.onetonline.org/link/summary/25-1065.00', 'Political Science Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in political science, international affairs, and international relations. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(19309400, 'https://www.onetonline.org/link/summary/19-3094.00', 'Political Scientists', 'Research, Development, Design, and Practitioners', 'Study the origin, development, and operation of political systems. May study topics, such as public opinion, political decisionmaking, and ideology. May analyze the structure and operation of governments, as well as various political entities. May conduct public opinion surveys, analyze election results, or analyze public documents.');
INSERT INTO ONetJobs values(19401201, 'https://www.onetonline.org/link/summary/19-4012.01', 'Precision Agriculture Technicians', 'Technologists and Technicians', 'Apply geospatial technologies, including geographic information systems (GIS) and Global Positioning System (GPS), to agricultural production or management activities, such as pest scouting, site-specific pesticide application, yield mapping, or variable-rate irrigation. May use computers to develop or analyze maps or remote sensing images to compare physical topography with data on soils, fertilizer, pests, or weather.');
INSERT INTO ONetJobs values(29122905, 'https://www.onetonline.org/link/summary/29-1229.05', 'Preventive Medicine Physicians', 'Research, Development, Design, and Practitioners', 'Apply knowledge of general preventive medicine and public health issues to promote health care to groups or individuals, and aid in the prevention or reduction of risk of disease, injury, disability, or death. May practice population-based medicine or diagnose and treat patients in the context of clinical health promotion and disease prevention.');
INSERT INTO ONetJobs values(29102400, 'https://www.onetonline.org/link/summary/29-1024.00', 'Prosthodontists', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, rehabilitate, design, and fit prostheses that maintain oral function, health, and appearance for patients with clinical conditions associated with teeth, oral and maxillofacial tissues, or the jaw.');
INSERT INTO ONetJobs values(29205300, 'https://www.onetonline.org/link/summary/29-2053.00', 'Psychiatric Technicians', 'Technologists and Technicians', 'Care for individuals with mental or emotional conditions or disabilities, following the instructions of physicians or other health practitioners. Monitor patients physical and emotional well-being and report to medical staff. May participate in rehabilitation and treatment programs, help with personal hygiene, and administer oral or injectable medications.');
INSERT INTO ONetJobs values(29122300, 'https://www.onetonline.org/link/summary/29-1223.00', 'Psychiatrists', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, and help prevent mental disorders.');
INSERT INTO ONetJobs values(19303900, 'https://www.onetonline.org/link/summary/19-3039.00', 'Psychologists, All Other', 'Research, Development, Design, and Practitioners', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(25106600, 'https://www.onetonline.org/link/summary/25-1066.00', 'Psychology Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in psychology, such as child, clinical, and developmental psychology, and psychological counseling. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(19409901, 'https://www.onetonline.org/link/summary/19-4099.01', 'Quality Control Analysts', 'Technologists and Technicians', 'Conduct tests to determine quality of raw materials, bulk intermediate and finished products. May conduct stability sample tests.');
INSERT INTO ONetJobs values(29112400, 'https://www.onetonline.org/link/summary/29-1124.00', 'Radiation Therapists', 'Research, Development, Design, and Practitioners', 'Provide radiation therapy to patients as prescribed by a radiation oncologist according to established practices and standards. Duties may include reviewing prescription and diagnosis; acting as liaison with physician and supportive care personnel; preparing equipment, such as immobilization, treatment, and protection devices; and maintaining records, reports, and files. May assist in dosimetry procedures and tumor localization.');
INSERT INTO ONetJobs values(17207201, 'https://www.onetonline.org/link/summary/17-2072.01', 'Radio Frequency Identification Device Specialists', 'Research, Development, Design, and Practitioners', 'Design and implement radio frequency identification device (RFID) systems used to track shipments or goods.');
INSERT INTO ONetJobs values(29203400, 'https://www.onetonline.org/link/summary/29-2034.00', 'Radiologic Technologists and Technicians', 'Technologists and Technicians', 'Take x-rays and CAT scans or administer nonradioactive materials into patients bloodstream for diagnostic or research purposes. Includes radiologic technologists and technicians who specialize in other scanning modalities.');
INSERT INTO ONetJobs values(29122400, 'https://www.onetonline.org/link/summary/29-1224.00', 'Radiologists', 'Research, Development, Design, and Practitioners', 'Diagnose and treat diseases and injuries using medical imaging techniques, such as x rays, magnetic resonance imaging (MRI), nuclear medicine, and ultrasounds. May perform minimally invasive medical procedures and tests.');
INSERT INTO ONetJobs values(19103102, 'https://www.onetonline.org/link/summary/19-1031.02', 'Range Managers', 'Research, Development, Design, and Practitioners', 'Research or study range land management practices to provide sustained production of forage, livestock, and wildlife.');
INSERT INTO ONetJobs values(29112500, 'https://www.onetonline.org/link/summary/29-1125.00', 'Recreational Therapists', 'Research, Development, Design, and Practitioners', 'Plan, direct, or coordinate medically-approved recreation programs for patients in hospitals, nursing homes, or other institutions. Activities include sports, trips, dramatics, social activities, and crafts. May assess a patient condition and recommend appropriate recreational activity.');
INSERT INTO ONetJobs values(29114100, 'https://www.onetonline.org/link/summary/29-1141.00', 'Registered Nurses', 'Research, Development, Design, and Practitioners', 'Assess patient health problems and needs, develop and implement nursing care plans, and maintain medical records. Administer nursing care to ill, injured, convalescent, or disabled patients. May advise patients on health maintenance and disease prevention or provide case management. Licensing or registration required.');
INSERT INTO ONetJobs values(19209901, 'https://www.onetonline.org/link/summary/19-2099.01', 'Remote Sensing Scientists and Technologists', 'Research, Development, Design, and Practitioners', 'Apply remote sensing principles and methods to analyze data and solve problems in areas such as natural resource management, urban planning, or homeland security. May develop new sensor systems, analytical techniques, or new applications for existing systems.');
INSERT INTO ONetJobs values(19409903, 'https://www.onetonline.org/link/summary/19-4099.03', 'Remote Sensing Technicians', 'Technologists and Technicians', 'Apply remote sensing technologies to assist scientists in areas such as natural resources, urban planning, or homeland security. May prepare flight plans or sensor configurations for flight trips.');
INSERT INTO ONetJobs values(29112600, 'https://www.onetonline.org/link/summary/29-1126.00', 'Respiratory Therapists', 'Research, Development, Design, and Practitioners', 'Assess, treat, and care for patients with breathing disorders. Assume primary responsibility for all respiratory care modalities, including the supervision of respiratory therapy technicians. Initiate and conduct therapeutic procedures; maintain patient records; and select, assemble, check, and operate equipment.');
INSERT INTO ONetJobs values(17219908, 'https://www.onetonline.org/link/summary/17-2199.08', 'Robotics Engineers', 'Research, Development, Design, and Practitioners', 'Research, design, develop, or test robotic applications.');
INSERT INTO ONetJobs values(17302401, 'https://www.onetonline.org/link/summary/17-3024.01', 'Robotics Technicians', 'Technologists and Technicians', 'Build, install, test, or maintain robotic equipment or related automated production systems.');
INSERT INTO ONetJobs values(41903100, 'https://www.onetonline.org/link/summary/41-9031.00', 'Sales Engineers', 'Sales', 'Sell business goods or services, the selling of which requires a technical background equivalent to a baccalaureate degree in engineering.');
INSERT INTO ONetJobs values(41401100, 'https://www.onetonline.org/link/summary/41-4011.00', 'Sales Representatives, Wholesale and Manufacturing, Technical and Scientific Products', 'Sales', 'Sell goods for wholesalers or manufacturers where technical or scientific knowledge is required in such areas as biology, engineering, chemistry, and electronics, normally obtained from at least 2 years of postsecondary education.');
INSERT INTO ONetJobs values(19303400, 'https://www.onetonline.org/link/summary/19-3034.00', 'School Psychologists', 'Research, Development, Design, and Practitioners', 'Diagnose and implement individual or schoolwide interventions or strategies to address educational, behavioral, or developmental issues that adversely impact educational functioning in a school. May address student learning and behavioral problems and counsel students or families. May design and implement performance plans, and evaluate performance. May consult with other school-based personnel.');
INSERT INTO ONetJobs values(19406100, 'https://www.onetonline.org/link/summary/19-4061.00', 'Social Science Research Assistants', 'Technologists and Technicians', 'Assist social scientists in laboratory, survey, and other social science research. May help prepare findings for publication and assist in laboratory analysis, quality control, or data management.');
INSERT INTO ONetJobs values(25106900, 'https://www.onetonline.org/link/summary/25-1069.00', 'Social Sciences Teachers, Postsecondary, All Other', 'Postsecondary Teaching', 'All postsecondary social sciences teachers not listed separately.');
INSERT INTO ONetJobs values(19309900, 'https://www.onetonline.org/link/summary/19-3099.00', 'Social Scientists and Related Workers, All Other', 'Research, Development, Design, and Practitioners', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(19304100, 'https://www.onetonline.org/link/summary/19-3041.00', 'Sociologists', 'Research, Development, Design, and Practitioners', 'Study human society and social behavior by examining the groups and social institutions that people form, as well as various social, religious, political, and business organizations. May study the behavior and interaction of groups, trace their origin and growth, and analyze the influence of group activities on individual members.');
INSERT INTO ONetJobs values(25106700, 'https://www.onetonline.org/link/summary/25-1067.00', 'Sociology Teachers, Postsecondary', 'Postsecondary Teaching', 'Teach courses in sociology. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.');
INSERT INTO ONetJobs values(15125200, 'https://www.onetonline.org/link/summary/15-1252.00', 'Software Developers', 'Research, Development, Design, and Practitioners', 'Research, design, and develop computer and network software or specialized utility programs. Analyze user needs and develop software solutions, applying principles and techniques of computer science, engineering, and mathematical analysis. Update software or enhance existing software capabilities. May work with computer hardware engineers to integrate hardware and software systems, and develop specifications and performance requirements. May maintain databases within an application area, working individually or coordinating database development as part of a team.');
INSERT INTO ONetJobs values(15125300, 'https://www.onetonline.org/link/summary/15-1253.00', 'Software Quality Assurance Analysts and Testers', 'Research, Development, Design, and Practitioners', 'Develop and execute software tests to identify software problems and their causes. Test system modifications to prepare for implementation. Document software and application defects using a bug tracking system and report defects to software or web developers. Create and maintain databases of known defects. May participate in software design reviews to provide input on functional requirements, operational characteristics, product designs, and schedules.');
INSERT INTO ONetJobs values(19101300, 'https://www.onetonline.org/link/summary/19-1013.00', 'Soil and Plant Scientists', 'Research, Development, Design, and Practitioners', 'Conduct research in breeding, physiology, production, yield, and management of crops and agricultural plants or trees, shrubs, and nursery stock, their growth in soils, and control of pests; or study the chemical, physical, biological, and mineralogical composition of soils as they relate to plant or crop growth. May classify and map soils and investigate effects of alternative practices on soil and crop productivity.');
INSERT INTO ONetJobs values(17219911, 'https://www.onetonline.org/link/summary/17-2199.11', 'Solar Energy Systems Engineers', 'Research, Development, Design, and Practitioners', 'Perform site-specific engineering analysis or evaluation of energy efficiency and solar projects involving residential, commercial, or industrial customers. Design solar domestic hot water and space heating systems for new and existing structures, applying knowledge of structural energy requirements, local climates, solar technology, and thermodynamics.');
INSERT INTO ONetJobs values(41401107, 'https://www.onetonline.org/link/summary/41-4011.07', 'Solar Sales Representatives and Assessors', 'Sales', 'Contact new or existing customers to determine their solar equipment needs, suggest systems or equipment, or estimate costs.');
INSERT INTO ONetJobs values(29112700, 'https://www.onetonline.org/link/summary/29-1127.00', 'Speech-Language Pathologists', 'Research, Development, Design, and Practitioners', 'Assess and treat persons with speech, language, voice, and fluency disorders. May select alternative communication systems and teach their use. May perform research related to speech and language problems.');
INSERT INTO ONetJobs values(29122906, 'https://www.onetonline.org/link/summary/29-1229.06', 'Sports Medicine Physicians', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, and help prevent injuries that occur during sporting events, athletic training, and physical activities.');
INSERT INTO ONetJobs values(15204100, 'https://www.onetonline.org/link/summary/15-2041.00', 'Statisticians', 'Research, Development, Design, and Practitioners', 'Develop or apply mathematical or statistical theory and methods to collect, organize, interpret, and summarize numerical data to provide usable information. May specialize in fields such as biostatistics, agricultural statistics, business statistics, or economic statistics. Includes mathematical and survey statisticians.');
INSERT INTO ONetJobs values(29124900, 'https://www.onetonline.org/link/summary/29-1249.00', 'Surgeons, All Other', 'Research, Development, Design, and Practitioners', 'All surgeons not listed separately.');
INSERT INTO ONetJobs values(29909300, 'https://www.onetonline.org/link/summary/29-9093.00', 'Surgical Assistants', 'Research, Development, Design, and Practitioners', 'Assist in operations, under the supervision of surgeons. May, in accordance with state laws, help surgeons to make incisions and close surgical sites, manipulate or remove tissues, implant surgical devices or drains, suction the surgical site, place catheters, clamp or cauterize vessels or tissue, and apply dressings to surgical site.');
INSERT INTO ONetJobs values(29205500, 'https://www.onetonline.org/link/summary/29-2055.00', 'Surgical Technologists', 'Technologists and Technicians', 'Assist in operations, under the supervision of surgeons, registered nurses, or other surgical personnel. May help set up operating room, prepare and transport patients for surgery, adjust lights and equipment, pass instruments and other supplies to surgeons and surgeons assistants, hold retractors, cut sutures, and help count sponges, needles, supplies, and instruments.');
INSERT INTO ONetJobs values(19302200, 'https://www.onetonline.org/link/summary/19-3022.00', 'Survey Researchers', 'Research, Development, Design, and Practitioners', 'Plan, develop, or conduct surveys. May analyze and interpret the meaning of survey data, determine survey objectives, or suggest or test question wording. Includes social scientists who primarily design questionnaires or supervise survey teams.');
INSERT INTO ONetJobs values(17303100, 'https://www.onetonline.org/link/summary/17-3031.00', 'Surveying and Mapping Technicians', 'Technologists and Technicians', 'Perform surveying and mapping duties, usually under the direction of an engineer, surveyor, cartographer, or photogrammetrist, to obtain data used for construction, mapmaking, boundary location, mining, or other purposes. May calculate mapmaking information and create maps from source data, such as surveying notes, aerial photography, satellite data, or other maps to show topographical features, political boundaries, and other features. May verify accuracy and completeness of maps.');
INSERT INTO ONetJobs values(17102200, 'https://www.onetonline.org/link/summary/17-1022.00', 'Surveyors', 'Technologists and Technicians', 'Make exact measurements and determine property boundaries. Provide data relevant to the shape, contour, gravitation, location, elevation, or dimension of land or land features on or near the earths surface for engineering, mapmaking, mining, land evaluation, construction, and other purposes.');
INSERT INTO ONetJobs values(15124101, 'https://www.onetonline.org/link/summary/15-1241.01', 'Telecommunications Engineering Specialists', 'Research, Development, Design, and Practitioners', 'Design or configure wired, wireless, and satellite communications systems for voice, video, and data services. Supervise installation, service, and maintenance.');
INSERT INTO ONetJobs values(29112900, 'https://www.onetonline.org/link/summary/29-1129.00', 'Therapists, All Other', 'Research, Development, Design, and Practitioners', '“All Other” titles represent occupations with a wide range of characteristics which do not fit into one of the detailed O*NET-SOC occupations. O*NET data is not available for this type of title. For specific occupations under this title, see:
INSERT INTO ONetJobs values(17205101, 'https://www.onetonline.org/link/summary/17-2051.01', 'Transportation Engineers', 'Research, Development, Design, and Practitioners', 'Develop plans for surface transportation projects, according to established engineering standards and state or federal construction policy. Prepare designs, specifications, or estimates for transportation facilities. Plan modifications of existing streets, highways, or freeways to improve traffic flow.');
INSERT INTO ONetJobs values(19309901, 'https://www.onetonline.org/link/summary/19-3099.01', 'Transportation Planners', 'Research, Development, Design, and Practitioners', 'Prepare studies for proposed transportation projects. Gather, compile, and analyze data. Study the use and operation of transportation systems. Develop transportation models or simulations.');
INSERT INTO ONetJobs values(19305100, 'https://www.onetonline.org/link/summary/19-3051.00', 'Urban and Regional Planners', 'Research, Development, Design, and Practitioners', 'Develop comprehensive plans and programs for use of land and physical facilities of jurisdictions, such as towns, cities, counties, and metropolitan areas.');
INSERT INTO ONetJobs values(29122903, 'https://www.onetonline.org/link/summary/29-1229.03', 'Urologists', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, and help prevent benign and malignant medical and surgical disorders of the genitourinary system and the renal glands.');
INSERT INTO ONetJobs values(17211202, 'https://www.onetonline.org/link/summary/17-2112.02', 'Validation Engineers', 'Research, Development, Design, and Practitioners', 'Design or plan protocols for equipment or processes to produce products meeting internal and external purity, safety, and quality requirements.');
INSERT INTO ONetJobs values(29113100, 'https://www.onetonline.org/link/summary/29-1131.00', 'Veterinarians', 'Research, Development, Design, and Practitioners', 'Diagnose, treat, or research diseases and injuries of animals. Includes veterinarians who conduct research and development, inspect livestock, or care for pets and companion animals.');
INSERT INTO ONetJobs values(29205600, 'https://www.onetonline.org/link/summary/29-2056.00', 'Veterinary Technologists and Technicians', 'Technologists and Technicians', 'Perform medical tests in a laboratory environment for use in the treatment and diagnosis of diseases in animals. Prepare vaccines and serums for prevention of diseases. Prepare tissue samples, take blood samples, and execute laboratory tests, such as urinalysis and blood counts. Clean and sterilize instruments and materials and maintain equipment and machines. May assist a veterinarian during surgery.');
INSERT INTO ONetJobs values(15125501, 'https://www.onetonline.org/link/summary/15-1255.01', 'Video Game Designers', 'Research, Development, Design, and Practitioners', 'Design core features of video games. Specify innovative game and role-play mechanics, story lines, and character biographies. Create and maintain design documentation. Guide and collaborate with production staff to produce games as designed.');
INSERT INTO ONetJobs values(11912102, 'https://www.onetonline.org/link/summary/11-9121.02', 'Water Resource Specialists', 'Managerial', 'Design or implement programs and strategies related to water resource issues such as supply, quality, and regulatory compliance issues.');
INSERT INTO ONetJobs values(17205102, 'https://www.onetonline.org/link/summary/17-2051.02', 'Water/Wastewater Engineers', 'Research, Development, Design, and Practitioners', 'Design or oversee projects involving provision of potable water, disposal of wastewater and sewage, or prevention of flood-related damage. Prepare environmental documentation for water resources, regulatory program compliance, data management and analysis, and field work. Perform hydraulic modeling and pipeline design.');
INSERT INTO ONetJobs values(15129901, 'https://www.onetonline.org/link/summary/15-1299.01', 'Web Administrators', 'Research, Development, Design, and Practitioners; Technologists and Technicians', 'Manage web environment design, deployment, development and maintenance activities. Perform testing and quality assurance of web sites and web applications.');
INSERT INTO ONetJobs values(15125500, 'https://www.onetonline.org/link/summary/15-1255.00', 'Web and Digital Interface Designers', 'Research, Development, Design, and Practitioners', 'Design digital user interfaces or websites. Develop and test layouts, interfaces, functionality, and navigation menus to ensure compatibility and usability across browsers or devices. May use web framework applications as well as client-side code and processes. May evaluate web design following web and accessibility standards, and may analyze web use metrics and optimize websites for marketability and search engine ranking. May design and test interfaces that facilitate the human-computer interaction and maximize the usability of digital devices, websites, and software with a focus on aesthetics and design. May create graphics used in websites and manage website content and links.');
INSERT INTO ONetJobs values(15125400, 'https://www.onetonline.org/link/summary/15-1254.00', 'Web Developers', 'Research, Development, Design, and Practitioners', 'Develop and implement websites, web applications, application databases, and interactive web interfaces. Evaluate code to ensure that it is properly structured, meets industry standards, and is compatible with browsers and devices. Optimize website performance, scalability, and server-side code and processes. May develop website infrastructure and integrate websites with other computer applications.');
INSERT INTO ONetJobs values(17219910, 'https://www.onetonline.org/link/summary/17-2199.10', 'Wind Energy Engineers', 'Research, Development, Design, and Practitioners', 'Design underground or overhead wind farm collector systems and prepare and develop site specifications.');
INSERT INTO ONetJobs values(19102300, 'https://www.onetonline.org/link/summary/19-1023.00', 'Zoologists and Wildlife Biologists', 'Research, Development, Design, and Practitioners', 'Study the origins, behavior, diseases, genetics, and life processes of animals and wildlife. May specialize in wildlife research and management. May collect and analyze biological data to determine the environmental effects of present and potential use of land and water habitats.');
